import React from 'react';
import { motion } from 'framer-motion';
import { ArrowUpIcon, ArrowDownIcon } from '@heroicons/react/24/solid';
import { KPI } from '../types';

interface KPICardProps {
  kpi: KPI;
}

const KPICard: React.FC<KPICardProps> = ({ kpi }) => {
  const formatValue = (value: string | number, format: string) => {
    if (typeof value === 'string') return value;

    switch (format) {
      case 'currency':
        return new Intl.NumberFormat('it-IT', {
          style: 'currency',
          currency: 'EUR',
          minimumFractionDigits: 2
        }).format(value);
      case 'percentage':
        return `${value}%`;
      case 'duration':
        return `${Math.floor(value / 3600)}h ${Math.floor((value % 3600) / 60)}m`;
      case 'number':
      default:
        return new Intl.NumberFormat('it-IT').format(value);
    }
  };

  const getChangeColor = (changeType: string) => {
    switch (changeType) {
      case 'increase':
        return 'text-success-600';
      case 'decrease':
        return 'text-error-600';
      case 'neutral':
      default:
        return 'text-gray-500';
    }
  };

  const getChangeIcon = (changeType: string) => {
    switch (changeType) {
      case 'increase':
        return ArrowUpIcon;
      case 'decrease':
        return ArrowDownIcon;
      case 'neutral':
      default:
        return null;
    }
  };

  const ChangeIcon = getChangeIcon(kpi.changeType);

  return (
    <motion.div
      whileHover={{ scale: 1.02 }}
      className="card-hover bg-white dark:bg-gray-800"
    >
      {/* Header */}
      <div className="flex items-center justify-between mb-4">
        <h3 className="text-sm font-medium text-gray-600 dark:text-gray-400">
          {kpi.label}
        </h3>

        {kpi.change !== 0 && (
          <div className={`flex items-center space-x-1 ${getChangeColor(kpi.changeType)}`}>
            {ChangeIcon && <ChangeIcon className="w-4 h-4" />}
            <span className="text-xs font-medium">
              {Math.abs(kpi.change).toFixed(1)}%
            </span>
          </div>
        )}
      </div>

      {/* Value */}
      <div className="mb-4">
        <div className="text-2xl font-bold text-gray-900 dark:text-white">
          {formatValue(kpi.value, kpi.format)}
        </div>
      </div>

      {/* Trend Mini Chart */}
      {kpi.trend && kpi.trend.length > 0 && (
        <div className="h-12">
          <svg className="w-full h-full" viewBox="0 0 100 40" preserveAspectRatio="none">
            <defs>
              <linearGradient id={`gradient-${kpi.label}`} x1="0%" y1="0%" x2="0%" y2="100%">
                <stop 
                  offset="0%" 
                  stopColor={kpi.changeType === 'increase' ? '#22C55E' : kpi.changeType === 'decrease' ? '#EF4444' : '#3B82F6'} 
                  stopOpacity={0.3}
                />
                <stop 
                  offset="100%" 
                  stopColor={kpi.changeType === 'increase' ? '#22C55E' : kpi.changeType === 'decrease' ? '#EF4444' : '#3B82F6'} 
                  stopOpacity={0}
                />
              </linearGradient>
            </defs>

            {/* Area */}
            <path
              d={generatePath(kpi.trend, true)}
              fill={`url(#gradient-${kpi.label})`}
            />

            {/* Line */}
            <path
              d={generatePath(kpi.trend, false)}
              fill="none"
              stroke={kpi.changeType === 'increase' ? '#22C55E' : kpi.changeType === 'decrease' ? '#EF4444' : '#3B82F6'}
              strokeWidth="2"
              className="drop-shadow-sm"
            />
          </svg>
        </div>
      )}
    </motion.div>
  );
};

// Helper function to generate SVG path
function generatePath(data: Array<{ x: string; y: number }>, isArea: boolean): string {
  if (data.length === 0) return '';

  const maxY = Math.max(...data.map(d => d.y));
  const minY = Math.min(...data.map(d => d.y));
  const range = maxY - minY || 1;

  const points = data.map((point, index) => {
    const x = (index / (data.length - 1)) * 100;
    const y = 40 - ((point.y - minY) / range) * 35; // Leave 5px padding top/bottom
    return `${x},${y}`;
  });

  if (isArea) {
    const firstX = points[0].split(',')[0];
    const lastX = points[points.length - 1].split(',')[0];
    return `M ${firstX},40 L ${points.join(' L ')} L ${lastX},40 Z`;
  } else {
    return `M ${points.join(' L ')}`;
  }
}

export default KPICard;
